import React from "react";

function ConfirmButton() {
  return (
    <button onClick={this.handleConfirm} disabled={this.state.isConfirmed}>
      {this.state.isConfirmed ? "확인됨" : "확인하기"}
    </button>
  );
}

export default ConfirmButton;
